/* HECMW_ablex_destroy is for both reentrant and non-reentrant scanners. */
int HECMW_ablex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		HECMW_ab_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		HECMW_abpop_buffer_state();
	}

	/* Destroy the stack itself. */
	HECMW_abfree((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * HECMW_ablex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

